import react from "react";
import { Style } from "./Form.styles";


export default function PopUp(props) {


	return (
		<Style>
			{location ? (
			<GoogleMapReact 
				bootstrapURLKeys={{key: process.env.REACT_APP_GOOGLE_MAPS_API_KEY}}
				defaultCenter={{ lat: location.latitude, lng: location.longitude}}
				defaultZoom={3}
				yesIWantToUseGoogleMapApiInternals
				onGoogleApiLoaded= {({map}) => {
					mapRef.current = map;
				}}
				onChange={({zoom, bounds}) => {
					setZoom(zoom)
					setBounds([
						bounds.nw.lng,
						bounds.se.lat,
						bounds.se.lng,
						bounds.nw.lat
					])
				}}

			>			
			{/* 1 Person */}
			<Marker 
				key={1} 
				lat={location.latitude} 
				lng={location.longitude}

				>
				<div onClick= {(children) => {
					mouseOver({children})
				}}>
					<img className = "crime-marker" src={personimg} alt="scooter" />
				</div>	
			</Marker>
			{/* Alla cyklar */}
			{showBikesOrNot ? (
			bikeArray.map(bike => {
			return (
			<Marker 
				key={bike.id} 
				lat={bike.location.latitude} 
				lng={bike.location.longitude}
				>

				<div
							onClick={() => setPopupInfo(bike)}

				className="crime-marker">
				<img className = "scooter" src={bikeimg} alt="scooter"/>
				</div>
			</Marker>
			)
			})
			) : (console.log("HE"))}

			</GoogleMapReact>
			):(<p>Loading...</p> )}

			{popupInfo && (<PopUp store={popupInfo} style={{ position: 'absolute', top: 0, left: 0, width: '200px' }} />)}

		</Style>	

	);
}
